import React from 'react';
import axios from 'axios';
import { ButtonDropdown, DropdownToggle, DropdownMenu, DropdownItem, Button } from 'reactstrap';

class Acceuil extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      quartiers: []
    };
  };

  componentDidMount() {
    axios
      .get('/user/clubs')
      .then(res => res.data)
      .then(result =>
        this.setState({
          quartiers: result
        })
      );
  };

  render() {
    return (
      <div>
        <img src="" alt="boxeuse"></img>
        <Button>Référence ton club</Button>
        <ButtonDropdown >
          <DropdownToggle caret>
            Choisis un quartier
      </DropdownToggle>

